import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import {library} from '@fortawesome/fontawesome-svg-core';
import { faCode, faUpRightFromSquare } from '@fortawesome/free-solid-svg-icons';

import "../styles/Tab.css";

library.add(faUpRightFromSquare, faCode)

function ProjCard(props) {
    return ( 
        <div className="card">
            <h3 className="cardHeader">{props.title}</h3>
            <div className="blur-load blur-load-proj" style={{backgroundImage: "url(" + props.small + ")"}}>
                <img className="cardImg" style={{display:none}} src={props.img} alt={props.alt} height={225} loading={"lazy"}></img>
            </div>
            <p className="cardDesc">{props.language}</p>
            <div className="links">
                <a href={props.github} id="link">
                    <FontAwesomeIcon icon="fa-solid fa-code" size="xs"/> Github Repository
                </a>
                <a href={props.preview} id="link" style={(props.language === 'react native' ? {visibility: 'hidden'} : {})}>
                    <FontAwesomeIcon icon="fa-solid fa-up-right-from-square" size="xs"/> Live Preview
                </a>
            </div>
        </div>
     );
}

export default ProjCard;
